<p>The Model-</p>
<pre><code>package com.example.demo.helpers.model;

import org.springframework.data.annotation.Id;
import org.springframework.data.mongodb.core.mapping.Document;

import java.util.Objects;

@Document(collection = &quot;Employee&quot;)
public class Employee {

    @Id
    private String id;
    private String firstName;
    private String lastName;
    private String deptName;

    public Employee(){

    }

    public Employee(String id, String firstName, String lastName, String deptName) {
        this.id = id;
        this.firstName = firstName;
        this.lastName = lastName;
        this.deptName = deptName;
    }

    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (o == null || getClass() != o.getClass()) return false;
        Employee employee = (Employee) o;
        return Objects.equals(id, employee.id);
    }



    public String getId() {
        return id;
    }

    public void setId(String id) {
        this.id = id;
    }

    public String getFirstName() {
        return firstName;
    }

    public void setFirstName(String firstName) {
        this.firstName = firstName;
    }

    public String getLastName() {
        return lastName;
    }

    public void setLastName(String lastName) {
        this.lastName = lastName;
    }

    public String getDeptName() {
        return deptName;
    }

    public void setDeptName(String deptName) {
        this.deptName = deptName;
    }

    @Override
    public String toString() {
        return &quot;Employee[&quot; +
                firstName +
                &quot;, &quot; + lastName +
                &quot;, &quot; + deptName +
                ']';
    }
}
</code></pre>
<p>The Repo-</p>
<pre><code>package com.example.demo.helpers.repository;
import com.example.demo.helpers.model.Employee;
import org.springframework.stereotype.Repository;
import org.springframework.data.mongodb.repository.MongoRepository;

@Repository
public interface EmpRepo extends MongoRepository&lt;Employee, String&gt;{

    public Employee findByFirstName(String firstName);

}
</code></pre>
<p>The Controller-</p>
<pre><code>package com.example.demo.helpers.controller;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.*;

import com.example.demo.helpers.model.Employee;
import com.example.demo.helpers.repository.EmpRepo;

import java.util.List;
import java.util.Optional;

@RestController
public class EmpController {

    private static final Logger logger = LoggerFactory.getLogger(EmpController.class);

    @Autowired
    private EmpRepo empRepo;

    public EmpController(EmpRepo empRepo) {
        this.empRepo = empRepo;
    }


    @GetMapping(&quot;/employees&quot;)
    List&lt;Employee&gt; all() {
        System.out.println(empRepo.findAll());
        return empRepo.findAll();
    }

    @PostMapping(&quot;/employees&quot;)
    Employee newEmployee(@RequestBody Employee newEmployee) {
        System.out.println(&quot;----Inside api-----&quot;);
        return empRepo.save(newEmployee);
    }

    @GetMapping(&quot;/employees/{id}&quot;)
    Optional&lt;Employee&gt; one(@PathVariable String id) {
        return empRepo.findById(id);
    }
}
</code></pre>
