Mongodb Error codes and corresponding http status code<p>So, if a new user tries to sign up with an user account that already exists, MongoDb responds with a <a href="https://github.com/mongodb/mongo/blob/2cf31060a74ac438b58c5150ba30da4144112744/src/mongo/base/error_codes.err" rel="nofollow noreferrer">11000 error code</a></p>
<p>In Express, that can be handled like this:</p>
<pre><code>async function signup(req, res, next){
  try{ 
  // some stuff
  }catch(err){
    if (err.code === 11000) {
      err.message = 'Email is already taken.';
      res.statusCode = 409;
    }
    return next(err);
  }     
}
</code></pre>
<p>For this example, I decided to respond with a 409 http status code.</p>
<p>However, I am not sure if it's a good approach to handle several different codes from MongoDB and assigning an http status for each of them.</p>
<p>What other solutions am I missing?</p>

