How to lookup an array of objects and still retain the object properties?<p>Here is the code in <a href="https://mongoplayground.net/p/8rqns62r7Io" rel="nofollow noreferrer">mongodb playground</a>.</p>
<p>I have a query that looks like below:</p>
<pre><code>    db.posts.aggregate({
      $lookup: {
        from: &quot;users&quot;,
        let: {comments: &quot;$comments&quot;},
        pipeline: [
          {$match: {$expr: {$in: [&quot;$_id&quot;, &quot;$$comments.userId&quot;]} }},
          {&quot;$addFields&quot;:{&quot;text&quot;: &quot;$$comments.text&quot;}}
        ],
        as: &quot;comments&quot;
      }
    })
</code></pre>
<p>The problem with this query is that the <code>text</code> value I get is is an array containing the texts from all <code>comments</code>. If I try to filter by <code>userId</code>, I get another problem. If a user has commented more than once the <code>text</code> value will be an array containing all of their <code>comments</code>.</p>
<p>How can I get the looked up user and their comment as in one object?</p>
<p><strong>EDIT</strong></p>
<p>I expect a result that looks like below:</p>
<pre><code>[
  {
    &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000000&quot;),
    &quot;id&quot;: &quot;1&quot;,
    &quot;comments&quot;: [
      {
        &quot;_id&quot;: &quot;u1&quot;,
        &quot;name&quot;: &quot;James&quot;,
        &quot;username&quot;: &quot;jamo&quot;,
        &quot;text&quot;: &quot;Hi there, who are you?&quot;
