MongoDB aggregation - $regexMatch on array field<p>I'm using Mongo's <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/regexMatch/" rel="nofollow noreferrer">$regexMatch</a> operator to find documents where at least part of a field matches the pattern, and this works fine for root-level fields. But how do I use it with array fields? I want to return a match if at least one of the array elements matches the pattern.</p>
<p>For example, let's say the collection has these two documents:</p>
<pre><code>{
  &quot;_id&quot;: ObjectId(&quot;5ff6335c1570ba63ca5ac21e&quot;),
  &quot;requirements&quot;: [
    {
      &quot;description&quot;: &quot;Bachelor of Science required for this blah blah blah&quot;,
      &quot;code&quot;: &quot;ABC&quot;
    },
    {
      &quot;description&quot;: &quot;Also much experience in JavaScript blah&quot;,
      &quot;code&quot;: &quot;XYZ&quot;
    }
  ]
},

{
  &quot;_id&quot;: ObjectId(&quot;5ff6335b1570ba63ca5abefb&quot;),
  &quot;requirements&quot;: [
    {
      &quot;description&quot;: &quot;Master of Arts WANTED NOW!&quot;,
      &quot;code&quot;: &quot;TTT&quot;
    },
    {
      &quot;description&quot;: &quot;5+ experience required in C++&quot;,
      &quot;code&quot;: &quot;QQQ&quot;
    }
  ]
}
</code></pre>
<p>and something like this pipeline</p>
<pre><code>db.Collection.aggregate([
  { $match:
     { $expr:
        { $regexMatch: { 
          input: '$requirements.description', 
          regex: /^.*?\bblah blah blah\b.*?$/im 
        } } 
     } 
  }
])
</code></pre>
<p>should return <em>just</em> the first document since its first element inside <code>requirements</code> matches on <code>description</code> containing &quot;blah blah blah&quot;
(&quot;Bachelor of Science required for this blah blah blah&quot;).</p>
<p>However this just throws me an error saying '$regexMatch needs <code>input</code> to be of type string'. And replacing it with <code>$requirements[0].description</code> doesn't work either.</p>
<p>So is there a way to regex match array fields in Mongo?</p>

